<extref href="../FA399/overview">FA399 Rockefeller Foundation records, Field Office, Ankara, Turkey.</extref>"], "$": "transformer.resources.Subnote"}], "$": "transformer.resources.Note"}, {"type": "multipart", "title": "Scope and Contents note", "source": "archivesspace", "subnotes": [{"type": "text", "content": ["The International Health Board of the Rockefeller Foundation maintained an office in Paris from 1917 as the headquarters for the work of the Commission for the Prevention of Tuberculosis in France. In 1922, anticipating the transfer of the tuberculosis work to the French, and the expansion of work in Europe, the Board agreed to share space and administrative expenses with the Rockefeller Foundation's Division of Medical Education. The Nursing Survey of the IHB was to be carried on from the same location. Other administrative units of the Foundation concerned with work in Europe used the same office.

The Paris office can be described as a colony of more or less independent units, occupying the same office space, loosely bound together under a chairman and a committee, both advisory in function, and sharing common services. The chairman of the Paris office exercised a general oversight, acting as advisor and coordinator. He was the representative of the President in Paris in the sense that he transmitted all general instruction from the central executives to the group while in the other direction he was spokesman for the group to New York. He had full Power of Attorney for all Rockefeller Foundation property in France. All bank accounts were in his name. He called together and presided over the Paris officers in committees for discussions of mutual problems and in consultation with them either agreed to or rejected their various fellowships and grants-in-aid dockets, his signature being required, as well as that of the Comptroller and divisional representative concerned, on all Paris office grants. Chairmen of the Paris office before World War II were Selskar M. Gunn, 1922-1932; George K. Strode, 1932-1938; A. J. Warren, 1938-1939; and Selskar M. Gunn, 1939-1940.

The office committee, which corresponded roughly to the staff conference in New York, had no legal status whatever yet acquired with the years a definite function. All officers' actions or grants-in-aid, grants for deposed scholars, and fellowships passed through this committee. Here, questions of general policy were discussed.

Officers in divisions in Paris had an integrity and autonomy unknown in New York, that granted by sheer remoteness from the main office. From fund allocated by directors in New York for expenditure in Europe, officers had the power of independent action without reference to New York, limited however to grants-in-aid and fellowships of not more than one year and $3,000.

The Paris office was the fiscal agent of the New York office with respect to European affairs. The Paris office administered payments under appropriations made by the Trustees in New York for European projects. The Comptroller also administered payments under officers actions in Paris, and acted as fiscal agent for the General Education Board and for the national councils with respect to fellows assigned to Europe for study.

The Administrator of the Paris office was charged with the non-divisional functions of the office, i.e., personnel, office quarters, equipment, central services, travel, purchasing, etc. The budget was made up in two sections, the principal part in francs, the lesser in dollars.

Divisions represented at the Paris office before World War II were the International Health Board, later the International Health Division, the Division of Studies, the Division of Medical Education, the Medical Sciences Division, the Divisions of Natural and social Sciences. Officers assigned to the Paris office included F. Elisabeth Crowell, E. E. Day, Alan Gregg, Selskar M. Gunn, Lauder Jones, Tracey B. Kittredge, Robert A. Lambert, H. M. Miller, Daniel P. O'Brien, Richard M. Pearce, F. F. Russell, George K. Strode, Wilbur E. Tisdale, John Van Sickle, George E. Vincent, A. J. Warren, and Warren Weaver.

In 1941, the Paris office closed for the duration of the war. The space was used for a time by an agency of the Vichy Government under the direction of Dr. Alexis Carrell, and the Foundation's work in Europe was continued by the newly formed Rockefeller Foundation Health Commission. One staff member, the Comptroller, Robert Letort, a native Frenchman, remained on the payroll looking after the Foundation's interests. In 1945 Letort and Charles N. Leach, a member of the RHC, reopened the office. It remained open until 1959, but its functions and character were completely changed. It became a place maintained for the convenience of a small group of officers assigned more or less permanently to Paris and for the convenience also of the somewhat larger group who used Paris as a base for European travel. It still had a chairman with whom the New York office, usually through the vice president, corresponded on questions of general policy. Only two divisions, Medical Sciences and International Health Division, maintained permanent staff. The Paris office postwar had no funds for allocation of grants-in-aid and fellowships. These were administered from New York. Except for payments to French projects, all appropriations to European projects were now paid from New York. The Staff maintained services such as filing and bookkeeping and provided secretarial service. Personnel assigned to the Paris office in the postwar period included Johannes H. Bauer, Elizabeth W. Brackett, Robert P. Burden, John B. Grant, Frederic C. Lane, Charles N. Leach, John Maier, H. M. Miller, Daniel P. O'Brien, Paul Russell, R. Rolf Struthers, Mary E. Tennant. Chairmen of the Paris office were Rolf Struthers, 1946-1954, and John Maier, 1954-1959."], "$": "transformer.resources.Subnote"}], "$": "transformer.resources.Note"}, {"type": "multipart", "title": "Conditions Governing Access note", "source": "archivesspace", "subnotes": [{"type": "text", "content": ["Records more than 20 years old are open for research with select materials restricted as noted. Brittle or damaged items are available at the discretion of RAC. Researchers interested in accessing digital media (floppy disks, CDs, DVDs, etc.) or audiovisual material (audio cassettes, VHS, etc.) in this collection must use an access surrogate. The original items may not be accessed because of preservation concerns. To request an access surrogate be made, or if you are unsure if there is an access surrogate, please contact an archivist."], "$": "transformer.resources.Subnote"}], "$": "transformer.resources.Note"}, {"type": "multipart", "title": "Arrangement note", "source": "archivesspace", "subnotes": [{"type": "text", "content": ["The files of the Paris office have been sorted and weeded several times over the years. What remains is far from a complete record. The arrangement, however, is as received; that is, these files were not processed through the New York office but were in storage since shipment from France. The filing system has not been altered."], "$": "transformer.resources.Subnote"}], "$": "transformer.resources.Note"}, {"type": "multipart", "title": "Related Archival Materials note", "source": "archivesspace", "subnotes": [{"type": "text", "content": ["Records related to those of the Paris office include minutes of meetings of the Paris office committee which can be found in Record Group 3, Administration, Program and Policy, Series 904 Officers Conferences. Program and policy reports relevant to Paris office administration are 900 Org. 33, 900 Org. 36, 900 Pro. 16. There is also material in Record Group 1.1, Projects, Series 700, European Office Administration, as well as Series 500, France."], "$": "transformer.resources.Subnote"}], "$": "transformer.resources.Note"}], "agents": [], "terms": [{"external_identifiers": [{"identifier": "/subjects/75", "source": "archivesspace", "$": "transformer.resources.ExternalIdentifier"}], "order": null, "title": "/subjects/75", "type": null, "uri": null, "re