RELATED MATERIALS

The following Record Groups in the Rockefeller Foundation Archives at the Rockefeller Archive Center contain material bearing upon the Foundation's work in India:

RG 1.1: Projects; RG 1.2: Projects; RG 2: General Correspondence; RG 3: Administration, Program, and Policy; RG 5: International Health Board; RG 6.13: Mexico Field Office; RG 12: Officers' Diaries; RG 13: Oral Histories, RF Field Officers.

Annual reports of the Rockefeller Foundation; Confidential Monthly Report, for the Information of the Trustees.

PHOTOGRAPHS

Four folders of photographs were removed from Record Group 6.7 during processing and added to the Photograph Collection of the Archive Center. These photographs are filed by country number, 464 India, and thereunder alphabetically by subject. They are interfiled with other photographs of India taken from Record Group 1.1 and 1.2 (Projects). Included are photographs of CIMMYT work in Mexico (n.d.), agricultural scenes in India (1958-59), compartment cages used for rearing the sorghum shoot fly (1971), and a disbound scrapbook of captioned photographs (1957) showing investigations into the virus known as Kyasanoor Forest Disease."], "$": "transformer.resources.Subnote"}], "$": "transformer.resources.Note"}, {"type": "multipart", "title": "Conditions Governing Access note", "source": "archivesspace", "subnotes": [{"type": "text", "content": ["Records more than 20 years old are open for research with select materials restricted as noted. Brittle or damaged items are available at the discretion of RAC. Researchers interested in accessing digital media (floppy disks, CDs, DVDs, etc.) or audiovisual material (audio cassettes, VHS, etc.) in this collection must use an access surrogate. The original items may not be accessed because of preservation concerns. To request an access surrogate be made, or if you are unsure if there is an access surrogate, please contact an archivist."], "$": "transformer.resources.Subnote"}], "$": "transformer.resources.Note"}], "agents": [], "terms": [{"external_identifiers": [{"identifier": "/subjects/33", "source": "archivesspace", "$": "transformer.resources.ExternalIdentifier"}], "order": null, "title": "/subjects/33", "type": null, "uri": null, "relator": null, "role": null, "level": null, "expression": null, "identifier": null, "$": "transformer.resources.Reference"}, {"external_identifiers": [{"identifier": "/subjects/85", "source": "archivesspace", "$": "transformer.resources.ExternalIdentifier"}], "order": null, "title": "/subjects/85",