Finding Aid entered into Archivists' Toolkit by Robert Battaly, December 2012."], "$": "transformer.resources.Subnote"}], "$": "transformer.resources.Note"}, {"type": "multipart", "title": "Conditions Governing Access", "source": "archivesspace", "subnotes": [{"type": "text", "content": ["Records more than 20 years old are open for research with select materials restricted as noted. Brittle or damaged items are available at the discretion of RAC. Researchers interested in accessing digital media (floppy disks, CDs, DVDs, etc.) or audiovisual material (audio cassettes, VHS, etc.) in this collection must use an access surrogate. The original items may not be accessed because of preservation concerns. To request an access surrogate be made, or if you are unsure if there is an access surrogate, please contact an archivist."], "$": "transformer.resources.Subnote"}], "$": "transformer.resources.Note"}, {"type": "multipart", "title": "Preferred Citation", "source": "archivesspace", "subnotes": [{"type": "text", "content": ["Information regarding the Rockefeller Archive Center's preferred elements and forms of citation can be found at <extref href="http://www.rockarch.org/research/citations.php">http://www.rockarch.org/research/citations.php</extref>"], "$": "transformer.resources.Subnote"}], "$": "transformer.resources.Note"}, {"type": "singlepart", "title": "Language of Materials", "source": "archivesspace", "subnotes": [{"type": "text", "content": ["Documentation in these files may be written in languages other than english", "including primarily portuguese or spanish. "], "$": "transformer.resources.Subnote"}], "$": "transformer.resources.Note"}, {"type": "multipart", "title": "Conditions Governing Use", "source": "archivesspace", "subnotes": [{"type": "text", "content": ["Researchers who visit the Rockefeller Archive Center are granted permission to examine archival material.  Permission to cite, quote from, or publish material from the Center's collections must be requested separately by writing. See Archivists for details

A formal request for such permission should include the name of the collection(s) from which the relevant material is drawn; the title of the proposed article, book, or dissertation; the journal title for articles; the name of the publisher for books or the university for dissertations; and the anticipated date of publication 

RAC users must abide by all applicable provisions of United States copyright law. Reproduction/duplication of archival items is routinely provided in accordance with “fair use”. If the RAC does not hold copyright for an archival collection, or items within a collection, it is the users’ responsibility to contact the copyright holder, or make a fair effort to do so, prior to publication."], "$": "transformer.resources.Subnote"}], "$": "transformer.resources.Note"}, {"type": "multipart", "title": "Conditions Governing Use", "source": "archivesspace", "subnotes": [{"type": "text", "content": ["Rockefeller Foundation retains title, copyright and literary rights to all Rockefeller Foundation records in so far as it holds them. "], "$": "transformer.resources.Subnote"}], "$": "transformer.resources.Note"}, {"type": "multipart", "title": "Biographical / Historical", "source": "archivesspace", "subnotes": [{"type": "text", "content": ["The Rockefeller Foundation operated several field laboratories in the 1950s and 1960s, in conjunction with  its virus research program centered at the Rockefeller Institute in New York.

The field office in Belem, Brazil, operated from 1954–1971 as a laboratory for the study of arthropod- or insect-borne viruses. Created in collaboration with the Servico Especiales de Saude Publica (Special Service of Public Health), the Belem virus laboratory sought to classify these viruses and examine the way they presented in humans and domesticated animals.

Ottis R. Causey  was the first director of the virus laboratory. He and his wife, Calista Eliot Causey, established the laboratory in 1954, and Causey remained director until 1963. Causey received his Doctor of Science degree  in entomology, parasitology, and bacteriology from Johns Hopkins University. During his career with the Rockefeller Foundation, Causey devoted himself to the field of arbovirology. Under his tenure, the lab isolated about 1,600 viruses, of which 50 were found to be distinct viruses.

In the mid-1960s, the Rockefeller Foundation began to phase out its virus research program. The New York laboratory  was incorporated into the Yale School of Medicine in 1964, becoming the Yale Arbovirus Research Unit,  and several of the foundation's field laboratories integrated with universities or government research agencies. Robert E. Shope, M.D., directed the Belem laboratory  from 1963 through June 1965, and was succeeded by John P. Woodall, who served until the field office's closing in 1971. 

In the course of its existence, the Belem Virus Laboratory was responsible for isolating many viruses. Seeking to determine which viruses were present in their specific region, researchers studied blood samples from monkeys, mice, and humans. This isolation of viruses gave information about the prevalence of certain viruses and the conditions under which they were likely to occur. The laboratory established different methods for rapidly classifying viruses and new ways for monitoring the effects of the viruses on humans and animals. The laboratory made significant contributions to the knowledge of virus activity and lifecycles."], "$": "transformer.resources.Subnote"}], "$": "transformer.resources.Note"}, {"type": "multipart", "title": "Other Finding Aids", "source": "archivesspace", "subnotes": [{"type": "text", "content": ["Other available finding aids describing Rockefeller Foundation records, Field Offices include:

